import React, { useState, useEffect } from 'react';
import { getPLReports } from '../../services/api';

const Rating = ({ user }) => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchReports();
  }, []);

  const fetchReports = async () => {
    try {
      const response = await getPLReports();
      setReports(response.data);
    } catch (error) {
      console.error('Error fetching reports:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <div>Loading rating data...</div>;

  // Calculate program-wide statistics
  const totalAttendance = reports.reduce((sum, report) => sum + report.actual_students_present, 0);
  const totalCapacity = reports.reduce((sum, report) => sum + report.total_students_registered, 0);
  const overallAttendanceRate = totalCapacity > 0 ? (totalAttendance / totalCapacity * 100).toFixed(1) : 0;

  return (
    <div className="card">
      <div className="card-header">
        <h4>Program-wide Rating & Analytics</h4>
      </div>
      <div className="card-body">
        <div className="row mb-4">
          <div className="col-md-4">
            <div className="card bg-primary text-white">
              <div className="card-body text-center">
                <h5>Overall Attendance Rate</h5>
                <div className="display-4">{overallAttendanceRate}%</div>
              </div>
            </div>
          </div>
          <div className="col-md-4">
            <div className="card bg-success text-white">
              <div className="card-body text-center">
                <h5>Total Lectures</h5>
                <div className="display-4">{reports.length}</div>
              </div>
            </div>
          </div>
          <div className="col-md-4">
            <div className="card bg-info text-white">
              <div className="card-body text-center">
                <h5>Feedback Coverage</h5>
                <div className="display-4">
                  {reports.length > 0 ? 
                    Math.round((reports.filter(r => r.feedback_text).length / reports.length) * 100) : 0
                  }%
                </div>
              </div>
            </div>
          </div>
        </div>

        <h5>Lecturer Performance Overview</h5>
        {reports.length === 0 ? (
          <p>No data available for analysis.</p>
        ) : (
          <div className="table-responsive">
            <table className="table table-striped">
              <thead>
                <tr>
                  <th>Lecturer</th>
                  <th>Total Reports</th>
                  <th>Avg Attendance</th>
                  <th>Feedback Received</th>
                  <th>Performance</th>
                </tr>
              </thead>
              <tbody>
                {Array.from(new Set(reports.map(r => r.lecturer_name))).map(lecturer => {
                  const lecturerReports = reports.filter(r => r.lecturer_name === lecturer);
                  const avgAttendance = lecturerReports.reduce((sum, r) => 
                    sum + (r.actual_students_present / r.total_students_registered), 0) / lecturerReports.length * 100;
                  
                  return (
                    <tr key={lecturer}>
                      <td>{lecturer}</td>
                      <td>{lecturerReports.length}</td>
                      <td>{avgAttendance.toFixed(1)}%</td>
                      <td>{lecturerReports.filter(r => r.feedback_text).length}</td>
                      <td>
                        <span className={`badge ${
                          avgAttendance >= 80 ? 'bg-success' :
                          avgAttendance >= 60 ? 'bg-primary' :
                          avgAttendance >= 40 ? 'bg-warning' : 'bg-danger'
                        }`}>
                          {avgAttendance >= 80 ? 'Excellent' :
                           avgAttendance >= 60 ? 'Good' :
                           avgAttendance >= 40 ? 'Fair' : 'Needs Improvement'}
                        </span>
                      </td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default Rating;
